import React from 'react';
import Rolex from '../assets/pictures/rolex.jpg'
import { useState } from 'react'
import { Routes, Route, Outlet, useNavigate } from 'react-router-dom'

function User() {
    const navigate = useNavigate()
    const [pictureArr, SetPictureArr] = useState([
        {
            img: Rolex,
            name: 'Rolex 01',
            price: 100000
        },
        {
            img: Rolex,
            name: 'Rolex 02',
            price: 200000
        },
        {
            img: Rolex,
            name: 'Rolex 03',
            price: 300000
        },
        {
            img: Rolex,
            name: 'Rolex 04',
            price: 400000
        },
        {
            img: Rolex,
            name: 'Rolex 05',
            price: 100000
        },
        {
            img: Rolex,
            name: 'Rolex 06',
            price: 200000
        },
        {
            img: Rolex,
            name: 'Rolex 07',
            price: 300000
        },
        {
            img: Rolex,
            name: 'Rolex 08',
            price: 400000
        }
    ])

    let elementProduct = pictureArr.map((picture, index) => {
        return <>
            <div className='productDetail'>
                <img src={Rolex} />
                <p>Name: {picture.name}</p>
                <p>Price: {picture.price}</p>
                <button onClick={() => navigate('/user/productdetail')}>Detail</button>
            </div>
        </>
    })

    return (
        <Route>

            <>
                <main>
                    <h1>User Page</h1>
                    <div className='user'>
                        {elementProduct}
                    </div>
                </main>
                <Outlet />
            </>
        </Route>
    )
};

export default User
